PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?team ?teamLabel WHERE {
  fb:m.05cb70 fb:sports.pro_athlete.teams ?roster .
  ?roster fb:sports.sports_team_roster.team ?team .
  OPTIONAL {
    ?team rdfs:label ?teamLabel .
    FILTER ( lang( ?teamLabel ) = "en" )
  }
  ?roster fb:sports.sports_team_roster.from ?fromDate .
  FILTER ( datatype( ?fromDate ) = xsd:gYear || datatype( ?fromDate ) = xsd:date || datatype( ?fromDate ) = xsd:dateTime ) .
  FILTER ( ?fromDate <= "2011-12-31" ^^ xsd:date || ?fromDate <= "2011" ^^ xsd:gYear ) .
  OPTIONAL {
    ?roster fb:sports.sports_team_roster.to ?toDate .
    FILTER ( datatype( ?toDate ) = xsd:gYear || datatype( ?toDate ) = xsd:date || datatype( ?toDate ) = xsd:dateTime ) .
  }
  FILTER ( ! BOUND( ?toDate ) || ?toDate >= "2011-01-01" ^^ xsd:date || ?toDate >= "2011" ^^ xsd:gYear ) .
}

